import logo from './img/logo.png';
import brasil from './img/brasil.png';
import espanha from './img/espanha.png';
import inglaterra from './img/inglaterra.png';
function Cabecalho(props) {
    return (
        <header class="header">
            <a href="/home"><img src={logo} width="180px" height="40px"  alt='logo'></img></a>
            <form>
            <div class ="barradepesquisa" id="barradepesquisa">
            <input type ="text" name="pesquisar" placeholder="O que está procurando ? "></input>
            <a href="#"> <i class ="fas fa-search"></i></a>
            </div>
            </form>

            <nav>
            <ul class="menu">

            <li><a href="/sobre">Minha conta&nbsp; <i class ="fas fa-user-circle"></i></a></li>
            <li>&nbsp; &nbsp; <a href="#loja"><i class ="fas fa-shopping-cart"> &nbsp; |&nbsp; </i></a></li>
            <li><img src={brasil} width="30px" height="20px" alt="br"></img></li>&nbsp;
            <li><img src={espanha} width="30px" height="20px" alt="es"></img></li>&nbsp;
            <li><img src={inglaterra} width="30px" height="20px" alt="en"></img></li>

            </ul>
            </nav>
        </header>
    );
}

